  ,openHours0hours           VARCHAR(40) default "" 
  ,openHours1days            VARCHAR(40) default "" 
  ,openHours1hours           VARCHAR(40) default "" 
  ,openHours2days            VARCHAR(40) default "" 
  ,openHours2hours           VARCHAR(40) default "" 
  ,openHours3days            VARCHAR(40) default "" 
  ,openHours3hours           VARCHAR(40) default "" 
  ,openHours4days            VARCHAR(40) default "" 
  ,openHours4hours           VARCHAR(40) default "" 
  ,openHours5days            VARCHAR(40) default "" 
  ,openHours5hours           VARCHAR(40) default "" 
  ,openHours6days            VARCHAR(40) default "" 
  ,openHours6hours           VARCHAR(40) default "" 
  ,rko                       VARCHAR(40) default "" 
  ,openHoursIndividual0days  VARCHAR(40) default "" 
  ,openHoursIndividual0hours VARCHAR(40) default "" 
  ,openHoursIndividual1days  VARCHAR(40) default "" 
  ,openHoursIndividual1hours VARCHAR(40) default "" 
  ,openHoursIndividual2days  VARCHAR(40) default "" 
  ,openHoursIndividual2hours VARCHAR(40) default "" 
